text:
A 25-point outing from sophomore KJ Cochran leads @WCEastBBall to a 67-54 win over @PWHSBasketball. 

The top of District 1 5A is the strongest it’s been since the new classification system. Cochran’s building on a strong freshman season. 

@aceshoops v. Chester (@JhPeach27) next

